insert into place (id, name, latitude, longitude, address, description, guide) values (51, '영진전문대학 본관', 35.8967938,128.6208255, '대구광역시 북구 복현로 35', '영진전문대학교의 본관입니다.', '영진전문대학교의 본관이며 컴퓨터 정보계열, 간호학과가 있습니다');
