insert into place (id, name, latitude, longitude, address, description, guide) values (54, '영진전문대학 도서관', 35.8951761,128.6226156, '대구광역시 북구 복현로 35', '영진전문대학교의 도서관입니다.', '영진전문대학교의 도서관 입니다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (55, '경삼감영공원', 35.8723185,128.5924362, '대구광역시 중구 경상감영길 99', '대구에 위치한 경삼감영공원입니다.', '조선시대에 들어서면서부터 성장을 거듭한 대구지역은 임진왜란을 거치면서 국방상의 중요성까지 부각되어 마침내 안동에 있던 경상감영을 대구로 옮기게 되었습니다. 본래 경상감영은 현 대구달성공원에 위치하고 있었고, 잠시 안동으로 옮겨졌다가 선조 34년 관찰사 김신원 때 지금 이곳으로 이전 되었습니다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (56, '2.28기념 중앙공원', 35.8696893,128.5975719, '대구광역시 중구 성내1동 15', '대구에 중앙로에 위치한 2.28기념중앙공원입니다.', '1940년~1995년까지 중앙국민학교가 있던 자리에 1960년 2·28학생민주의거를 기념하여 2003년에 만든 공원입니다. 2.28의거에 이어서 3·15, 4·19 등 역사적인 아픔이 담긴 곳이지만 현재는 대구 시민들의 편안하고 쾌적한 휴식처가 되었으며, 대구 시내에 위치하여 많은 시민들이 찾는 휴식공간이며, 데이트 장소이기도 합니다. 시원함을 더해주는 분수와 나무그늘도 많아 시민들이 시원하게 쉬었다 가는 공원으로 자리매김하였습니다.' );
insert into place (id, name, latitude, longitude, address, description, guide) values (57, '국채보상운동기념공원', 35.8687869,128.6020548, '대구광역시 중구 동인동 48-4', '대구에 위치한 국채보상운동기념공원입니다.', '국채보상운동의 숭고한 정신을 기리고 많은 시민들에게 휴식공간을 제공하기 위하여 조성한 국채보상운동기념공원은 42,509㎡(12,858평)의 면적에 22.5t의 달구벌 대종, 종각, 시원스럽게 뿜어대는 분수, 화합의 광장 등이 조성되어 있습니다. 지하에 3층 규모의 동인지하주차장이 마련되어 있어 시민들의 주차 공간 확보를 돕고 있으며, 중앙도서관을 끼고 있습니다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (58, '하트해변' , 37.0597708,129.4282332, '경상북도 울진군 죽변면 죽변중앙로 235-10', '울진에 위치한 하트해변입니다', '하트해변은 울진 죽변항에 위치에 있고 폭풍속으로 촬영지로 작은 한적한 바닷가 마을이 세트장이 되어서 유명해진 곳입니다. 바다 모양이 하트모양이고 탁트인 동해바다와 세트장 어부집이 마치 한폭의 그림같은 풍경을 보여줍니다. 멀리 죽변등대도 볼 수 있고 우측 대나무숲으로 가면 용의 꿈길 해안데크길이 있습니다. 해안길을 따라서 시원한 바다와 아름다운 바다풍경 바라보며 산책하는 것도 좋습니다. 울진 죽변등대는 일제강점기 등대로 2005년 9월 경상북도의 기념물 제 154호로 지정되었습니다. 산책하면서 하트모양 해변을 둘러 봅시다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (59, '죽변해안스카이레일', 37.0555574,129.4275192, '경상북도 울진군 죽변면 죽변리 3-26', '울진에 위치한 스카이레일바이크입니다', '죽변해안스카이레일은 울진 바다를 가장 가까이에서 바라볼 수 있는 모노레일로 각각 A코스(죽변항~봉수항, 2.8km, 1시간 소요), B코스(후정해변~봉수항, 2km, 40분 소요), 왕복(죽변항~후정해변~죽변항, 4.8km, 2시간 소요), 편도(죽변항~후정해변 or 후정해변~죽변항, 2.4km, 50분 소요)로 나뉩니다. 자동으로 움직이는 무인 모노레일이며, 죽변항부터 후정해변까지 시속 5km의 속도로 2.4km 구간을 달립니다. 중간에 봉수항 정차장이 있지만 표를 살 수 있는 곳은 죽변항과 후정해변 두 곳뿐입니다. 100% 선착순이므로 오는 순서에 따라 탑승 시간이 정해집니다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (60, '국립해양과학관', 37.0732187,129.4075432, '경상북도 울진군 죽변면 해양과학길 8', '울진에 위치한 국립해양과학관입니다', '국립해양과학관은 전체 무료이며, 매주 화요일 ~ 일요일 개장입니다. 운영시간은 10:00 ~ 17:00/ 1일 6회차 운영하고 휴관일은 매주 월요일, 공휴일입니다. 관람시 유의사항으로는 음식물과 반려견 전시장 내 금연이며 바다에 대해 여러 가지 알 수 있는 곳입니다. 다양한 볼거리와 체험을 할수 있고 바다마중길이 393m로 이색적인 경험을 할 수 있습니다. 해중전망대에서 다바를 내려 보세요');
insert into place (id, name, latitude, longitude, address, description, guide) values (61, '등기산공원', 36.6822282,129.4637722, '경상북도 울진군 후포면 후포리 560-4', '울진에 위치한 등기산공원입니다', '스카이워크에서 이어져 있으며 등기산이라는 표지석을 중심으로 각종 조형물들과 포토스팟이 있습니다 해안경치가 조화를 이루는 공원입니다. 스카이워크쪽 경치와 해안선 방파제쪽 경치가 좋으며 다른나라 등대모형도 있어서 다양한 볼거리와 함께 산책하면서 쉬기 좋은 장소입니다. 주차공간이 부족하니 대중교통 이용하시면 편합니다. 스카이워크와 등기산공원을 천천히 돌아보면 한시간 정도 소요되니 천천히 산책하기에 추천드립니다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (62, '울진갓바위전망대', 36.6800234,129.4651472, '경상북도 울진군 후포면 후포리 산144', '울진에 위치한 울진갓바위 전망대입니다.', '위치는 등기산스카이워크 아래에 있는곳이며 후포스카이워크 아래쪽에 있는 갯바위로 팔공산 갓바위와 같이 바다의 갓바위라고하는 장소스카이워크에서 바라보는 경치가 장관이며옆으로 투명한 바다색깔이 정말 깨끗함바위에서 낚시하는 사람들도 있으며바위정상부에 물이 고여있을것을 보니파도가 강한경우 바위정상부까지파도가 넘어가는듯스카이워크 끝에서 아래쪽 바위경치도 좋고후포항쪽 방파제 경치나윗쪽 해안선 모래사장 경치도 장관이므로울진에 간다면 후포스카이워크 끝에가서멋진경치를 감상하는걸 추천드립니다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (63, '김광석 다시그리기길', 35.8599223,128.6066308, '대구광역시 중구 대봉동', '대구에 위치한 김광석 다시그리기길입니다.', '김광석 길은 故 김광석이 살았던 대봉동 방천시장 인근 골목에 김광석의 삶과 음악을 테마로 조성한 벽화거리이다. 2010년 방천시장 문정성시 사업의 하나로 방천시장 골목길에 11월부터 조성하기 시작한 김광석 길은 중구청과 11팀의 작가들이 참여하였다. 350m 길이의 벽면을 따라 김광석 조형물과 포장마차에서 국수 말아주는 김광석, 바다를 바라보고 있는 김광석 등 골목의 벽마다 김광석의 모습과 그의 노래 가사들이 다양한 모습의 벽화로 그려졌다. 매년 가을에는 방천시장과 동성로 일대에서 김광석 노래 부르기 경연대회를 개최하여 故 김광석을 추억하고 있다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (64, '경산시립박물관', 35.8141474,128.76294, '경상북도 경산시 동부동 655-1', '경산에 위치한 경산시립박물관입니다.', '경산시립박물관은 고대부터 현대에 이르는 경산의 문화유산을 종합적이고 체계적으로 연구 보존하는 기능, 역사와 문화를 한눈에 볼수있는 전시기능, 우수한 우리문화와 역사를 체험하고 배울수 있는 평생학습기능을 모두 갖춘 종합문화 공간이다. 상설전시관으로는 제1,2,3전시실이 있으며, 그외 영상기획실, 특별전시실, 어린이 체험학습실, 야외전시장이 있다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (65, '앞산전망대', 35.8244832,128.5796656, '대구광역시 남구 대명9동 앞산순환로', '대구에 위치한 앞산전망대입니다.', '앞산전망대는 대구 시가지를 한눈에 조망할 수 있는 관광명소로 앞산전망대의 건축물은 도시와 자연, 역사와 미래를 함께 엮어낸 성공적인 건축물로 평가되고 있다. 또한 앞산전망대는 관광객이 많이 찾는 곳이기도 하지만 무엇보다 대구에서 먹고 자고 살아가는 대구 시민에게 대구가 어떤 도시라는 산교육을 할 수 있는 교육장의 역할도 하고 있다. 가는 방법은 큰골에서 케이블카를 이용해 전망대에 이르는 방법(15분 소요)과안지랑골에서 등산로를 이용해 전망대까지 도보로 이용(1시간 소요)하는 방법이 있다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (66, '마비정벽화마을', 35.778882,128.5418712, '대구광역시 달성군 화원읍 본리리', '대구에 위치한 마비정벽화마을입니다.', '35가구의 담장에 그려진 꽃과 나무, 동물, 장승, 옛날 농기계 등 향토적인 벽화들을 만나볼 수 있는 마을이다. 이곳은 연리목과 연리지 사랑나무, 수령 60년의 옻나무, 사랑나무로 알려진 수령 100년의 돌배나무, 장수 거북바위 등 다양한 볼거리가 많아 관광객들에게 인기가 높다.');
insert into place (id, name, latitude, longitude, address, description, guide) values (67, '이월드', 35.8533844,128.5638548, '대구광역시 달서구 두류공원로 200', '대구에 위치한 이월드입니다.', '365일 밤이 아름다운 로맨틱한 이월드! 4계절 꽃의 향기가 있는 이월드!! 대구의 상징 83타워! 역대 최 고 높이 103m 스카이드롭! 국내최초 360도 회전 메가스윙! 국내유일 거꾸로 가는 롤러코스터 부.메.랑! 가족/커플/친구와 함께 추억을 만드는 행복한 이월드입니다!!!');
